<html lang="en">
<head>

    <style>
        body {
            margin: 0;
            padding: 0;
            font-family: 'Roboto', sans-serif;
            overflow: hidden;
            background: #bb94d3;
            color: #fff;
        }

      .list-container::-webkit-scrollbar {
    display: none; /* Hides the scrollbar */
}

        #particles-js {
            position: fixed;
            width: 100%;
            height: 100%;
            z-index: -1;
        }

        .loader-container {
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            text-align: center;
            color: #fff;
            font-size: 20px;
            text-shadow: 0 0 10px rgba(255, 255, 255, 0.5);
        }

        .loader-box {
            background: rgba(255, 255, 255, 0.1);
            padding: 30px;
            border-radius: 10px;
            box-shadow: 0 0 20px rgba(255, 255, 255, 0.3);
            backdrop-filter: blur(10px);
            width: 550px;
            height: 300px;
            position: relative;
            overflow: hidden;
        }

        h2 {
            font-size: 36px;
            margin-top: 0;
        }

        .list-container {
            margin: 20px 0;
            padding: 10px;
            border-radius: 10px;
            background: rgba(255, 255, 255, 0.1);
            box-shadow: 0 0 20px rgba(255, 255, 255, 0.3);
            height: 150px;
            overflow-y: scroll;
        }

        .list-item {
            padding: 10px;
            border-bottom: 1px solid rgba(255, 255, 255, 0.2);
            cursor: pointer;
            transition: background 0.3s;
        }

        .list-item:hover {
            background: rgba(255, 255, 255, 0.2);
        }

        .button {
            background: rgba(255, 255, 255, 0.1);
            border: none;
            color: #fff;
            padding: 10px 20px;
            border-radius: 5px;
            box-shadow: 0 0 10px rgba(255, 255, 255, 0.3);
            font-size: 16px;
            cursor: pointer;
            position: absolute;
            bottom: 20px;
            left: 50%;
            transform: translateX(-50%);
            transition: opacity 1s;
        }

        .hidden {
            display: none;
        }

        .fade-in {
            opacity: 0;
            transition: opacity 1s;
        }

        .fade-in.visible {
            opacity: 1;
        }
    </style>
